"use strict";!async function(){await Site.loadApplet("julia-set-mosaic");let e=new JuliaSetMosaic($("#output-canvas")),t=$("#resolution-input");t.addEventListener("input",()=>{e.resolution=parseInt(t.value||500),e.changeAspectRatio()});let n=$("#set-density-input");n.addEventListener("input",()=>{e.setDensity=parseFloat(n.value||10)});let l=$("#exposure-input");l.addEventListener("input",()=>{e.exposure=parseFloat(l.value||1)});let u=$("#num-iterations-input");u.addEventListener("input",()=>{e.numIterations=parseInt(u.value||200)}),function a(){let i=parseInt(t.value||1e3),o=parseInt(n.value||10),r=parseFloat(l.value||1),s=parseInt(u.value||100);e.run(i,o,r,s)}();let a=$("#download-button");a.addEventListener("click",()=>{e.wilson.downloadFrame("a-generalized-julia-set.png")}),Page.show()}();